namespace _20200219
{
    [TestClass]
    public class Tenka1_2018_CTest
    {
        private void AssertIO(string input, string output)
        {
            StringReader reader = new StringReader(input);
            Console.SetIn(reader);

            StringWriter writer = new StringWriter();
            Console.SetOut(writer);

            Program.Tenka1_2018_C();

            Assert.AreEqual(output + Environment.NewLine, writer.ToString());
        }

        [TestMethod]
        public void 入力例_1()
        {
            string input =
@"5
6
8
1
2
3";
            string output =
@"21";

            AssertIO(input, output);
        }

        [TestMethod]
        public void 入力例_2()
        {
            string input =
@"6
3
1
4
1
5
9";
            string output =
@"25";

            AssertIO(input, output);
        }

        [TestMethod]
        public void 入力例_3()
        {
            string input =
@"3
5
5
1";
            string output =
@"8";

            AssertIO(input, output);
        }

    }


